    /// <inheritdoc />
    internal override void ValidateRequiredGeneratedChildren()
    {
    
        if (Url is null && PortalItem is null)
        {
            throw new MissingRequiredOptionsChildElementException(nameof(ImageryTileLayer), [nameof(Url), nameof(PortalItem)]);
        }
        if (MultidimensionalDefinition is not null)
        {
            foreach (DimensionalDefinition child in MultidimensionalDefinition)
            {
                child.ValidateRequiredGeneratedChildren();
            }
        }
        PixelDataSource?.ValidateRequiredGeneratedChildren();
        if (RasterFields is not null)
        {
            foreach (Field child in RasterFields)
            {
                child.ValidateRequiredGeneratedChildren();
            }
        }
        RasterFunction?.ValidateRequiredGeneratedChildren();
        ServiceRasterInfo?.ValidateRequiredGeneratedChildren();
        TileInfo?.ValidateRequiredGeneratedChildren();
        base.ValidateRequiredGeneratedChildren();
    }
      
